import studyImage from '../images/study.png'; // Import the image

export default function Board() {
    function getClassName(row, col) {
        if (row === 0 && col === 0) {
            return "study";
        }
        return ""; // Return empty string if no special class needed
    }

    return (
        <div className="board">
            {[...Array(5)].map((_, row) => (
                <div key={row} className="row">
                    {[...Array(5)].map((_, col) => (
                        <div key={`${row}-${col}`} className={getClassName(row, col)}>
                            {`${row}-${col}`}
                        </div>
                    ))}
                </div>
            ))}
        </div>
    );
}
